exports=async function(url,bid,cid,options){const{parseContentPaginate,getLinkElement}=await require("transcode/parse_content");return parseContentPaginate(page=>1===page?url:url.replace(/\/$/,`_${page}/`),"div#content",{clientOptions:{...(options&&options.clientOptions)},hasNextFn:html=>null!=/\/\d+_\d+\/\d+_\d+\//.exec(getLinkElement(html,"id=\"next_url\""))})};